class FollowingsTest(APITestCase):
    """
    Ensure we can get list of followings.
    Ensure we can unfollow a user.
    """
    def setUp(self):
        begard_user = get_user_model()
        self.user = begard_user.objects.create(email='test@gmail.com', password='testpass')
        self.token = Token.objects.create(user=self.user)
        self.client.credentials(HTTP_AUTHORIZATION="Token " + self.token.key)

        self.following_user_1 = begard_user.objects.create(email='following1@gmail.com', password='following1pass')
        self.following_user_2 = begard_user.objects.create(email='following2@gmail.com', password='following2pass')
        self.following_user_3 = begard_user.objects.create(email='following3@gmail.com', password='following3pass')
        self.following_user_4 = begard_user.objects.create(email='following4@gmail.com', password='following4pass')
        models.UserFollowing.objects.bulk_create([
            models.UserFollowing(user_id=self.user, following_user_id=self.following_user_1),
            models.UserFollowing(user_id=self.user, following_user_id=self.following_user_2),
            models.UserFollowing(user_id=self.user, following_user_id=self.following_user_3),
            models.UserFollowing(user_id=self.user, following_user_id=self.following_user_4)
        ])

    def test_list_of_followings(self):
        url = "/followings/"
        response = self.client.get(url)

        self.assertEqual(response.status_code, status.HTTP_200_OK)
        self.assertEqual(len(response.data), 4)

    def test_delete_followings_user(self):
        url = "/followings/{}/".format(self.following_user_1.id)
        response = self.client.delete(url)

        self.assertEqual(response.status_code, status.HTTP_200_OK)
        self.assertFalse(models.UserFollowing.objects.filter(user_id=self.user, following_user_id=self.following_user_1))


class FollowRequestTest(APITestCase):
    """
    Ensure we can create new follow request with appropriate response.
    Ensure we can delete a follow request by user
    """
    def setUp(self):
        begard_user = get_user_model()
        self.user = begard_user.objects.create(email='test@gmail.com', password='test_pass')
        self.token = Token.objects.create(user=self.user)
        self.client.credentials(HTTP_AUTHORIZATION="Token " + self.token.key)

        self.private_user_1 = begard_user.objects.create(email='private_user1@gmail.com', password='private_user1pass',
                                                         is_public=False)
        self.public_user_1 = begard_user.objects.create(email='public_user1@gmail.com', password='public_user1pass',
                                                        is_public=True)
        self.private_user_2 = begard_user.objects.create(email='private_user2@gmail.com', password='private_user2pass',
                                                         is_public=False)
        self.following_request_1 = models.FollowRequest.objects.create(request_from=self.user,
                                                                       request_to=self.private_user_2)

    def test_follow_requests(self):
        url = "/followings/requests/"
        response = self.client.post(url, {"request_to": self.public_user_1.id}, format='json')
        self.assertEqual(response.status_code, status.HTTP_201_CREATED)
        self.assertEqual(response.data['status'], "Followed")

        response = self.client.post(url, {"request_to": self.private_user_1.id}, format='json')
        self.assertEqual(response.status_code, status.HTTP_201_CREATED)
        self.assertEqual(response.data['status'], "Requested")

    def test_delete_follow_request(self):
        url = "/followings/requests/{}/".format(self.following_request_1.id)
        response = self.client.delete(url)
        self.assertEqual(response.status_code, status.HTTP_204_NO_CONTENT)
        self.assertFalse(models.FollowRequest.objects.filter(id=self.following_request_1.id).exists())


